import React from 'react';
import AppointmentRequest from '../component/AppointmentRequest';
import Appointment from '../component/Appointment';
import PatientChart from '../component/PatientChart';
import GenderChart from '../component/GenderChart';

const HomePage = () => {
  return (
    <div className="bg-gray-200 h-screen w-screen flex">
      
        <div className="bg-white w-[326px] h-screen mr-[39px]">

        </div>
        <div className="flex">
          <AppointmentRequest/>
          <div className="ml-[39px] mr-[39px]">
            <PatientChart/>
            <div className="mt-28">
              <GenderChart />
            </div>
          </div>
          <Appointment/>
        </div>
      
    </div>
  );
};


export default HomePage;
